
$(document).ready(function() {
    // Função para aceitar os cookies
    function aceitarCookies() {
        // Esconder o popup
        $('#ccc').hide();

        // Definir um cookie para lembrar a escolha por um certo período (por exemplo, 30 dias)
        var agora = new Date();
        var expiracao = new Date(agora.getTime() + 30 * 24 * 60 * 60 * 1000); // 30 dias
        document.cookie = "cookiesAceitos=true; expires=" + expiracao.toUTCString() + "; path=/";
    }

    // Função para rejeitar todos os cookies
    function rejeitarTodos() {
        // Esconder o popup
        $('#ccc').hide();

        // Definir um cookie para lembrar a escolha por um certo período (por exemplo, 30 dias)
        var agora = new Date();
        var expiracao = new Date(agora.getTime() + 30 * 24 * 60 * 60 * 1000); // 30 dias
        document.cookie = "cookiesRejeitados=true; expires=" + expiracao.toUTCString() + "; path=/";
    }

    // Verificar se o usuário já tomou uma decisão sobre os cookies
    function verificarCookiesAceitos() {
        var cookiesAceitos = document.cookie.includes('cookiesAceitos=true');
        var cookiesRejeitados = document.cookie.includes('cookiesRejeitados=true');

        if (cookiesAceitos || cookiesRejeitados) {
            // Se o usuário já tomou uma decisão, não mostrar o popup
            $('#ccc').hide();
        }
    }

    // Associar as funções aos botões
    $('#ccc-notify-accept').click(aceitarCookies);
    $('#ccc-notify-reject').click(rejeitarTodos);

    // Adicionar um evento de clique ao botão "Preferência de Cookie"
    $('#menu-item-43443 a').click(function(e) {
        e.preventDefault(); // Evita o comportamento padrão do link

        // Exibir o popup
        $('#ccc').show();
    });

    // Executar a verificação quando a página carregar
    verificarCookiesAceitos();
});

